import "../css/App.css";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Test from "./Test";
import Result from "./Result";
// import Header from "./Header";
// import Menu from "./Menu";

function App() {
  return (
    <div className="app">
      <Router>
        {/* <Header /> */}
        <Switch>
          <Route path="/result">
            <Result />
          </Route>
          <Route path="/">
            <Test />
          </Route>
          {/* <Route path="/">
            <Menu />
          </Route> */}
        </Switch>
      </Router>
    </div>
  );
}

export default App;
